import React, {Component} from 'react';


class Admin extends Component {

    constructor(props) {
      super(props);
      this.state = {
        renderiza: false,
        closed: false
      };
    }

    render() {
    return (
        <section id="content">

            <div className="content-wrap">

                <div className="container clearfix">

                    <div className="row clearfix">

                        <div className="col-md-9">

                            <div className="heading-block noborder">
                                <h3>Felix Felicis Store</h3>
                            </div>

                            <div className="clear"></div>

                            <div className="row clearfix">

                                <div className="col-lg-12">



                                </div>

                            </div>

                        </div>

                        <div className="w-100 line d-block d-md-none"></div>

                        <div className="col-md-3 clearfix">

                            <div className="list-group">
                                <a href="#" className="list-group-item list-group-item-action clearfix">Categorias <i className="icon-user float-right"></i></a>
                                <a href="#" className="list-group-item list-group-item-action clearfix">Sub Categorias <i className="icon-laptop2 float-right"></i></a>
                                <a href="#" className="list-group-item list-group-item-action clearfix">Produtos <i className="icon-envelope2 float-right"></i></a>
                                <a href="#" className="list-group-item list-group-item-action clearfix">Logout <i className="icon-line2-logout float-right"></i></a>
                            </div>

                        </div>

                    </div>

                </div>

            </div>

        </section>
        );
    }
}

export default Admin;
